          </div>

        </div>
        <div className="flex">
        
           <div className="ml-1">
            <p className="text-gray-500 text-xs text-right">Seller</p>
            <p className="font-medium text-sm">{seller}</p>
          </div>
          <img  className="w-12 h-12 object-cover object-center"src={imageSeller} alt="Berrys Auto"/>
        </div>
        <div>

        </div>

      </div>
    </div>
    </div>
}
